import "../index.css";
import { Link } from "react-dom";

function Navbar() {
  // const contact = function contactus() {
  //   return <h1>please contact for business</h1>;
  // };
  return (
    <div className="nav-bar">
      <ul>
        <li>
          <Link to="/"></Link>{" "}
        </li>
        <li>
          <Link to="/about"></Link>{" "}
        </li>
        <li>
          <Link to="/contact"></Link>{" "}
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
